import {useEffect, useState} from "react";
import axios from "axios";

function App() {
    const [message, setMessage] = useState('');

    useEffect(() => {
        axios.get('/api/test')
            .then((res) => {
                setMessage(res.data);
            })
    });
    return (
        <div className="App">
            백엔드 데이터: {message}
        </div>
    );
}

export default App;
